import React from "react";

const contact = () => {
  return (
    <div className="flex">
      <div>
        <div className="text-4xl text-white">Contact Me</div>
        <p className="text-white text-xl">
          <i class="fa-regular fa-envelope"></i>kumartheaman47@gmail.com
        </p>
        <p className="text-4xl text-white">
          <i class="fa-solid fa-phone text-[#9b59b6]"></i>9643465305
        </p>
      </div>
      <div></div>
    </div>
  );
};

export default contact;
